value:
({
  title,
  backButton,
}: {
  title?: string;
  backButton?: () => void;
}) => {
  return title ? (
    <Div className="flex items-center mb-10 ">
      {backButton && (
        <Div onClick={backButton} className={`p-4 cursor-pointer`}>
          back
        </Div>
      )}
      <H2 className="text-2xl font-bold">{title}</H2>
    </Div>
  ) : null;
}
